import React, { useEffect, useState } from 'react';

import classes from './finalists.module.css';
import Card from './UI/Card/Card';
import Item from './UI/Item/Item';

const Finalists = () => {
    const catData = {
        Pre_Teen: [
            {
                name: "Thabo Test",
                age: "9",
                image: "img/testPic.jpg"
            },
            {
                name: "Dudu Test",
                age: "9",
                image: "img/testPic.jpg"
            }
        ],
        Jnr_Teen: [
            {
                name: "Thabo Test",
                age: "9",
                image: "img/testPic.jpg"
            },
            {
                name: "Dudu Test",
                age: "9",
                image: "img/testPic.jpg"
            }
        ],
        Teen: [
            {
                name: "Thabo Test",
                age: "9",
                image: "img/testPic.jpg"
            },
            {
                name: "Dudu Test",
                age: "9",
                image: "img/testPic.jpg"
            }
        ],
        Senior: [
            {
                name: "Thabo Test",
                age: "9",
                image: "img/testPic.jpg"
            },
            {
                name: "Dudu Test",
                age: "9",
                image: "img/testPic.jpg"
            }
        ],
        Miss_Drag: [
            {
                name: "Thabo Test",
                age: "9",
                image: "img/testPic.jpg"
            },
            {
                name: "Dudu Test",
                age: "9",
                image: "img/testPic.jpg"
            }
        ]
    }

    const [ data, setData ] = useState({
        loading: false,
        error: false
    })

    const fetchPreTeen = catData.Pre_Teen.map((x) => (
        <Item 
            key={x.id}
            id={x.id}
            name={x.name}
            age={x.age}
            image={x.image}
            />
    ))


    return (
        <div id='finalists' className='text-center'>
            <div className='container'>
                <div className='section-title'>
                    <h2>Our Finalists</h2>
                    <div className={classes.cards}>
                        <div className={classes.card_column}>
                            
                        </div>
                    </div>


                    <Card head={"Pre Teen"}>
                        <ul>{fetchPreTeen}</ul>
                    </Card>
                </div>
            </div>
        </div>
    )
};

export default Finalists;
